import { useState } from "react";
import PropTypes from 'prop-types'
import Room from './Room'

import { 
  BrowserRouter,
  Routes,
  Route,
  useNavigate,
  Link, 
  Navigate
} from "react-router-dom";


const Rooms = ({userName}) => {
  let navigate = useNavigate();

  const back = async () => {
    navigate('/Dashboard');
  }

  const createRoom = async () => {
    navigate('/Dashboard');
  }

  const joinExistingRoom = async () => {
    navigate('/Room');
  }

  return (
    <div>
      <h1> Rooms</h1>
      <p>Hello  {userName}</p>
      <button onClick={back}> Back to Dashboard </button>

      <button onClick={createRoom}> Join Existing Room </button>
      <button onClick={joinExistingRoom}> Join Existing Room </button>
      </div>
  )
}

Rooms.defaultProps = {
  userName: 'User123',
}

export default Rooms
